import React,{Component} from 'react';
import "./Card.scss"

class Card extends Component {
    render() {


    return (
        <div>
            <div className="card__box">
                <img/>
                <div className="card__name">Apollo Running</div>
                <div className="card_price">$50.00</div>
            </div>
        </div>
    );
};
}

export default Card;
